import React from 'react';
import AppHeader from '../app_header/app-header';
import SearchPanel from '../search_panel/search-panel';
import StatusFilter from '../post_status/post-status-filter';
import PostList from '../postlist/post-list';
import PostAddForm from '../post-add-form';
import './app.css';
import './index.css';
import '../app_header/app-header.css';
import '../search_panel/search-panel.css';
import '../post_status/post-status-filter.css';
import '../postlist/post-list.css';
//import '../post-add-form/post-add-form.css';



const App = () => {
    const data = [{ label: 'Going to lern React', import: true,id:'bmbkmg' },
    { label: 'That is so good', import: false,id:'kbmmg' },
    { label: 'I need a break...', import: false ,id:'kbmbg'}
    ];
    return (
        <div className="app">
            <AppHeader />
            <div className="search-panel d-flex">
                <SearchPanel />
                <StatusFilter />
            </div>
            <PostList posts={data} />
            <PostAddForm />


        </div>
    )
}
export default App;
